import React, { Component } from 'react'
import {get, post} from 'axios'
import { CONSTANTS } from '../../../util/Constants'
import { trackPromise, usePromiseTracker } from 'react-promise-tracker';
import { ToastContainer, toast } from 'react-toastify';
import Loader from 'react-promise-loader';
import ModuleList from './ModuleList'
import MaterialList from './MaterialList';
import QuizList from './QuizList';
import ParticipantList from './ParticipantList';
import {connect} from 'react-redux'
import {MODULE_MENU, MATERIAL_MENU, QUIZ_MENU, PARTICIPANT_MENU} from './constants';
const url_syllabus = CONSTANTS.SYLLABUS;
const url_modules = CONSTANTS.MODULES;
const url_material = CONSTANTS.MATERIALS;
var moment = require('moment');

export default class Module extends Component {
  constructor(props) {
    super(props)

    this.state = {
        currentMenu:MATERIAL_MENU,
    }
    props.setHeader("Quiz");
    this.currentMenuUpdate = this.currentMenuUpdate.bind(this)
}

  currentMenuUpdate(currentMenu){
    this.setState({currentMenu})
  }

    render() {
          const {currentMenu} = this.state
            return (
              <div>
                <ToastContainer />
                <Loader promiseTracker={usePromiseTracker}  />
                <div className="container-fluid d-module padTop">
                  <div className="row syllabus-details">
                    {currentMenu === MATERIAL_MENU  ? <MaterialList {...this.props}  currentMenu={this.currentMenuUpdate}  /> : ''}
                    {currentMenu === QUIZ_MENU      ? <QuizList {...this.props} currentMenu={this.currentMenuUpdate} /> : ''}
                    {currentMenu === PARTICIPANT_MENU      ? <ParticipantList {...this.props} currentMenu={this.currentMenuUpdate} /> : ''}
                  </div>
                </div>
              </div>
            )
    }
}
